import React from 'react';
import Home from './Components/Home/Home';
import './App.css';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";



function App() {

  return (
      <div className="App">
    <Routes>
      <Route path='/' element={<Home/>}/><Route></Route>
    </Routes>
        </div >
  )
}

export default App;
